import React, { useState } from 'react';
import { motion } from 'framer-motion';
import '../styles/Contact.scss';

function Contact() {
    return (
        <div id='Contact'>
            <div className='contact-container'>
                <h1>Let's Create.</h1>
                <p>I'm always ready for another project,</p>
                <p>email me at <a href="mailto:someone@yoursite.com">jina.yu98@gmail.com</a></p>
                <p>or connect with me here:</p>
            </div>
            <motion.img 
                className='left-hand' 
                src='../img/left-hand.png' alt='left hand' 
                initial={{ x: '-50vw' }} 
                animate={{ x: 0 }} 
                transition={{ x: { ease: "easeOut", duration: 1 } }}
            />
            <motion.img 
                className='right-hand' 
                src='../img/right-hand.png' 
                alt='right hand' 
                initial={{ x: '50vw' }} 
                animate={{ x: 0 }} 
                transition={{ delay: 0.35, x: { ease: "easeOut", duration: 1 } }}
            />
        </div>
    );
}

export default Contact;
